eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   zhuangziQuotes: () => (/* binding */ zhuangziQuotes)\n/* harmony export */ });\nconst zhuangziQuotes = [\n    {\n        text: \"Once upon a time, I dreamt I was a butterfly, fluttering hither and thither, to all intents and purposes a butterfly. I was conscious only of my happiness as a butterfly, unaware that I was myself. Soon I awaked, and there I was, veritably myself again. Now I do not know whether I was then a man dreaming I was a butterfly, or whether I am now a butterfly, dreaming I am a man.\",\n        citation: \"\"\n    },\n    {\n        text: \"The fish-trap exists because of the fish. Once you've gotten the fish you can forget the trap. The rabbit-snout exists because of the rabbit. Once you've gotten the rabbit you can forget the snout. Words exist because of meaning. Once you've gotten the meaning you can forget the words. Where can I find a man who has forgotten words so I can talk with him?\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"Happiness is the abscence of the striving for happiness.\",\n        citation: \"\"\n    },\n    {\n        text: \"Let your heart be at peace.\\nWatch the turmoil of beings\\nhbut contemplate their return.\\nIf you don't realize the source,\\nyou stumble in confusion and sorrow.\\nWhen you realize where you come from,\\nyou naturally become tolerant,\\ndisinterested, amused,\\nkindhearted as a grandmother,\\ndignified as a king.\\nImmersed in the wonder of the Tao,\\nyou can deal with whatever life brings you,\\nAnd when death comes, you are ready.\",\n        citation: \"\"\n    },\n    {\n        text: \"During our dreams we do not know we are dreaming. We may even dream of interpreting a dream. Only on waking do we know it was a dream. Only after the great awakening will we realize that this is the great dream.\",\n        citation: \"\",\n        prompt: \"What would you change in your life if this was all just a dream?\"\n    },\n    {\n        text: \"Only he who has no use for the empire is fit to be entrusted with it.\",\n        citation: \"\"\n    },\n    {\n        text: \"If a man crosses a river\\nand an empty boat collides with his own skiff,\\nEven though he be bad tempered man\\nHe will not become very angry.\\nBut if he sees a man in the boat,\\nHe will shout at him to steer clear.\\nIf the shout is not heard, he will shout again, and yet again, and begin cursing.\\nAnd all because someone is in the boat.\\nYet if the boat were empty,\\nHe would not be shouting, and not angry.\\nIf you can empty your own boat\\nCrossing the river of the world,\\nNo one will oppose you,\\nNo one will seek to harm you\",\n        citation: \"\"\n    },\n    {\n        text: \"I cannot tell if what the world considers ‘happiness’ is happiness or not. All I know is that when I consider the way they go about attaining it, I see them carried away headlong, grim and obsessed, in the general onrush of the human herd, unable to stop themselves or to change their direction. All the while they claim to be just on the point of attaining happiness.\",\n        citation: \"\"\n    },\n    {\n        text: \"Just when the caterpillar thought the world was over, it became a butterfly.\",\n        citation: \"\"\n    },\n    {\n        text: \"If you have insight, you use your inner eye, your inner ear, to pierce to the heart of things, and have no need of intellectual knowledge.\",\n        citation: \"\"\n    },\n    {\n        text: \"The Perfect Man uses his mind like a mirror — going after nothing, welcoming nothing, responding but not storing.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"Great wisdom is generous; petty wisdom is contentious.\",\n        citation: \"\"\n    },\n    {\n        text: \"You have only to rest in inaction and things will transform themselves. Smash your form and body, spit out hearing and eyesight, forget you are a thing among other things, and you may join in great unity with the deep and boundless.\",\n        citation: \"\"\n    },\n    {\n        text: \"Men honor what lies within the sphere of their knowledge, but do not realize how dependent they are on what lies beyond it.\",\n        citation: \"\"\n    },\n    {\n        text: \"So it is said, for him who understands Heavenly joy, life is the working of Heaven; death is the transformation of things. In stillness, he and the yin share a single Virtue; in motion, he and the yang share a single flow.\",\n        citation: \"\"\n    },\n    {\n        text: \"Your life has a limit, but knowledge has none. If you use what is limited to pursue what has no limit, you will be in danger.\",\n        citation: \"\"\n    },\n    {\n        text: \"All attempts to create something admirable are the weapons of evil. You may think you are practising benevolence and righteousness, but in effect you will be creating a kind of artificiality. Where a model exists, copies will be made of it; where success has been gained, boasting follows; where debate exists, there will be outbreaks of hostility.\",\n        citation: \"\"\n    },\n    {\n        text: \"Cease striving. Then there will be transformation.\",\n        citation: \"\"\n    },\n    {\n        text: \"When there is no more separation between 'this' and 'that', it is called the still-point of the Dao. At the still-point in the center of the circle one can see the infinite in all things.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"Birth is not a beginning, death is not an end.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"He who knows does not speak; he who speaks does not know.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"The man of the Dao... lets his mind wander in simplicity, blending everything into the Great Unity.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"You can’t discuss the ocean with a well frog — he’s limited by the space he lives in.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"When the shoe fits, the foot is forgotten. When the belt fits, the belly is forgotten.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"The true man breathes with his heels; the mass of men breathe with their throats.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"He who clings to fame rejects what is truly his.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"There's nothing that isn't the 'that' of something else, and nothing that isn't the 'this' of something else.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"Heaven and Earth and I live together, and all things and I are one.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"This big tree is useless. That's why it has lived so long.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"Do not seek fame. Do not make plans. Do not be absorbed by activities. Do not think that you know.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    },\n    {\n        text: \"You were born when the moment came. You will die when the moment comes. The right thing is just to go along with the time.\",\n        citation: \"Zhuangzi, Burton Watson Translation\"\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./lib/zhuangzi-quotes.ts\n");

